def steps(step):
    from math import sqrt
    level_fl=sqrt(step)
    level=int(level_fl)
    steps=0
    if level % 2 == 0:
        level+=1
    elif (level_fl > level):
        level+=2
    for _ in range(1,level,2):
        steps+=1
    #print(steps)
    prevlevel=level - 2
    start=(prevlevel*prevlevel)
    end=level*level
    side_size=(end - start)/4
    for i in range(1,5):
        cur_end = start + side_size
        #print(cur_end)
        if step == cur_end:
            position = cur_end
            break
        if  step < cur_end and step >= start :
            side=i
            count_start=start
            count_end=cur_end
            middle=int((count_start+count_end)/2)
            position_added=abs(middle - step)
        start=cur_end
    return (steps + position_added)
